// 			<ul>
// 				<li>Washington Wizards at Cleveland Cavaliers - 7:00 PM ET</li>
// 				<li>Milwaukee Bucks at Detroit Pistons - 7:00 PM ET</li>
// 				<li>Philadelphia 76ers at Charlotte Hornets - 7:00 PM ET</li>
// 				<li>Orlando Magic at New York Knicks - 7:30 PM ET</li>
// 				<li>Indiana Pacers at Toronto Raptors - 7:30 PM ET</li>
// 				<li>Utah Jazz at Oklahoma City Thunder - 8:00 PM ET</li>
// 				<li>Memphis Grizzlies at Dallas Mavericks - 8:30 PM ET</li>
// 				<li>San Antonio Spurs at Phoenix Suns - 9:00 PM ET</li>
// 				<li>Golden State Warriors at Denver Nuggets - 10:00 PM ET</li>
// 				<li>New Orleans Pelicans at Atlanta Hawks - 7:30 PM ET</li>
// 				<li>Miami Heat at Boston Celtics - 7:30 PM ET</li>
// 			</ul>
// 		</div>
// 	);
// }

function NBAGames() {
	const gameStyle = {
		marginBottom: "20px",
	};

	const gridContainerStyle = {
		display: "flex",
		gap: "40px",
		position: "relative",
		marginLeft: "50px",
		marginBottom: "25px",
	};

	const gridStyle = {
		position: "relative",
	};

	const tableStyle = {
		borderCollapse: "collapse",
		marginTop: "10px",
	};

	const cellStyle = {
		border: "1px solid black",
		padding: "5px",
		textAlign: "center",
		width: "50px",
		height: "30px",
	};

	const yAxisLabelStyle = {
		position: "absolute",
		left: "-50px",
		top: "50%",
		transform: "translateY(-50%) rotate(-90deg)",
		whiteSpace: "nowrap",
	};

	const xAxisLabelStyle = {
		position: "absolute",
		bottom: "-25px",
		width: "100%",
		textAlign: "center",
	};

	const bookmakerLabelStyle = {
		textAlign: "center",
		marginBottom: "5px",
		fontWeight: "bold",
	};

	return (
		<div>
			<h1>NBA Games Happening Today</h1>
			<ul style={{ listStyleType: "none", padding: 0 }}>
				<li style={gameStyle}>
					Washington Wizards at Cleveland Cavaliers - 7:00 PM ET
					<div style={{ position: "relative" }}>
						<table style={tableStyle}>
							<div style={yAxisLabelStyle}>Spread</div>
							<div style={xAxisLabelStyle}>O/U</div>
							<tr>
								<td style={cellStyle}>3</td>
								<td style={cellStyle}>210</td>
							</tr>
							<tr>
								<td style={cellStyle}>-3</td>
								<td style={cellStyle}>215</td>
							</tr>
						</table>
					</div>
				</li>
				{/* Repeat the same structure for other games */}
			</ul>
		</div>
	);
}

export default NBAGames;
